loop = 0  # 循环计数

# 设定初始的次梯度
pre_slack_h1 = np.zeros(facility)
pre_slack_h2 = np.zeros(facility)
# print("--------------", len(h1), len(h2))
start = time.time()
while loop < 200:
	print("第{}次循环，GAP值为{}.".format(loop + 1, (best_value_ubound - best_value) / best_value_ubound))

	model = Lagrange_relaxation_model(q, h1, h2, c, f, level, facility, demand, lambda_, mju)

	# 记录松弛模型的目标值
	model.solve()
	lbound = model.objective_value
	print(">>>>>>>>>>>model.objective_value<<<<<<<<,", model.objective_value)
	# 记录松弛模型的解 z, x，这一部分不能省，还没找到合适的方法代替
	primary_z = np.zeros((demand, facility, level))
	primary_x = np.zeros(facility)
	for j in range(facility):
		primary_x[j] = model.x[j]
		for i in range(demand):
			for k in range(level):
				primary_z[i, j, k] = model.z[i, j, k]
	print(">>>>>>>>>>松弛问题建立的设施", primary_x)



	slack_h1 = np.zeros(facility)
	slack_h2 = np.zeros(facility)
	for j in J:
		slack_h1[j] = sum(primary_z[i, j, k] * h1[i] for i in I for k in K) - c[j] * primary_x[j]
		slack_h2[j] = sum(primary_z[i, j, k] * h2[i] for i in I for k in K) - c[j] * primary_x[j]

	print("-----------------------------------")
	print("slack_h1", slack_h1)
	print("slack_h2", slack_h2)
	print("-----------------------------------")



	# 生成拉格朗日乘子粘连参数
	if lbound > best_value:
		best_value = lbound
		same = 0
	else:
		same += 1

	if same == same_limit:
		scale = scale / 2
		same = 0

	# 获取上、下界目标函数值
	lbound_log.append(best_value)
	# 修复，获得可行解
	ubound = modify_z(primary_z, primary_x, facility, demand, level, q, f, c, h1, h2, I, J, K, best_value_ubound)

	if ubound < best_value_ubound:
		best_value_ubound = ubound
	print("修复后的目标函数值为：", ubound)
	ubound_log.append(best_value_ubound)

	lambda_, mju, pre_slack_h1, pre_slack_h2 = update_lam_mju(lambda_, mju, best_value_ubound, best_value, facility,
															  scale, primary_z, primary_x, I, J, K, h1, h2, c,
															  pre_slack_h1, pre_slack_h2)
	print("lambda的值为", lambda_)
	print("mju的值为", mju)

	# 循环计数
	loop += 1

end = time.time()
